      out.write("\t\t\t$(\"#actualLoanAmount\").val(actualLoanAmount);\r\n");
      out.write("\t\t\t$(\"#finalmonthRepay\").val(monthRepay);\r\n");
      out.write("\t\t}\r\n");
      out.write("\t}\r\n");
      out.write("\t\r\n");
      out.write("\t// 保存资质分析的信息\r\n");
